import './App.css';

function App() {
  const phrases = ['web app development','mobile app development','UI/UX design']
  return (
    <div style={container}>
      <div style={quote}>I'm Gokul , good in {phrases.map((item)=>`${item},`)}</div>
      <div style={cursor}></div>
    </div>
  );
}

const cursor = {
  height:'25px',
  width:'4px',
  backgroundColor:'green',
}


const container = {
  position:'absolute',
}

const quote={
  position:'relative'
}

export default App;
